import ExpenseItem from './ExpenseItem';
import './ExspensesList.css'

const ExpensesList = props => {
    let expensesContent = <p>No expenses found.</p>

    if (props.expenses.length > 0) {
        expensesContent = props.expenses.map((expense) => (<ExpenseItem key={expense.id} title={expense.title} amount={expense.amount} date={expense.date} />))

    }

    return (<ul className="expenses-list">
        {props.expenses.map((expense) => (<ExpenseItem key={expense.id} title={expense.title} amount={expense.amount} date={expense.date} />))}
    </ul>)

};

export default ExpensesList;
